another shameful incidence recently came to light where a man repeatedly sexually assaulted his 17 year old niece on the pretext of marriage.

the man was booked by the pimpri-chinchwad police after the girl was taken to the hospital where she delivered a baby in her seventh month. according to the report, the accused threatened to kill the victim if she narrated the incident to anyone. the victim told the police that the man is girl‚Äôs paternal uncle and promised to marry her after forcing himself on her. 
